import React from "react";

const HomePage = () => {
  return (
    <div className="w-11/12 flex items-center border ">
      <div className="w-4/12 border">
        <div className="border-2 flex justify-center w-12/12">
          <span className="w-12/12 border text-4xl font-thin centered-items text-orange-800 ">
            Apply4Job
          </span>
        </div>

        <div className="flex p-5 justify-end border-2">

        </div>
      </div>
    </div>
  );
};

export default HomePage;
